(function () {
	function appearAdvantages() {
		const advantages = document.querySelectorAll('.advantages__item');

		advantages.forEach(item => {
			const introPosition = item.getBoundingClientRect().top;
			const screenPosition = window.innerHeight / 1.35;

			if (introPosition < screenPosition) {
				item.classList.add('appear');
			}
		});
	}

	function appearTitle() {
		const title = document.querySelector('.about-us__title');
		const introPosition = title.getBoundingClientRect().top;
		const screenPosition = window.innerHeight / 1.4;
		if (introPosition < screenPosition) {
			title.classList.add('appear-title');
		}
	}

	function appearSubtitle() {
		const title = document.querySelector('.about-us__subtitle');
		const introPosition = title.getBoundingClientRect().top;
		const screenPosition = window.innerHeight / 1.5;
		if (introPosition < screenPosition) {
			title.classList.add('appear-title');
		}
	}

	window.addEventListener('scroll', appearAdvantages);
	window.addEventListener('scroll', appearTitle);
	window.addEventListener('scroll', appearSubtitle);
})();

(function () {
	const TxtRotate = function(el, toRotate, period) {
		this.toRotate = toRotate;
		this.el = el;
		this.loopNum = 0;
		this.period = parseInt(period, 10) || 2000;
		this.txt = '';
		this.tick();
		this.isDeleting = false;
	};

	TxtRotate.prototype.tick = function() {
		const i = this.loopNum % this.toRotate.length;
		const fullTxt = this.toRotate[i];

		if (this.isDeleting) {
			this.txt = fullTxt.substring(0, this.txt.length - 1);
		} else {
			this.txt = fullTxt.substring(0, this.txt.length + 1);
		}

		this.el.innerHTML = '<span class="wrap">' + this.txt + '</span>';

		const that = this;
		let delta = 300 - Math.random() * 100;

		if (this.isDeleting) delta /= 2;

		if (!this.isDeleting && this.txt === fullTxt) {
			delta = this.period;
			this.isDeleting = true;
		} else if (this.isDeleting && this.txt === '') {
			this.isDeleting = false;
			this.loopNum++;
			delta = 500;
		}

		setTimeout(function () {
			that.tick();
		}, delta);
	};

	window.onload = function () {
    const elements = document.querySelectorAll('.txt-rotate');
		for (const word of elements) {
			const toRotate = word.getAttribute('data-rotate');
			const period = word.getAttribute('data-period');

			if (toRotate) {
				new TxtRotate(word, JSON.parse(toRotate), period);
			}
		}
  };
})();

(function () {
	const form = document.querySelector('.form');
	const preloader = document.querySelector('.preloader');
	form.addEventListener('submit', formSend);

	async function formSend(e) {
		e.preventDefault();

		let error = formValidate(form);

		let formData = new FormData(form);

		if (error === 0) {
			preloader.classList.add('show');
			let response = await fetch('sendmail.php', {
				method: 'POST',
				body: formData,
			});
			if (response.ok) {
				let result = await response.json();
				renderOverlay(result.message, 'Ваш заказ принят! Мы с Вами свяжемся в ближайшее время.');
				preloader.classList.remove('show');
				form.reset();
			} else {
				renderOverlay(
					'Ошибка!',
					'Что то пошло не так, попробуйте повторить через некоторое время.',
				);
				preloader.classList.remove('show');
			}
		} else {
			renderOverlay(
				'Заполните поля!',
				'Прирожочек, заполни поля, либо проверь правильность заполненных полей.',
			);
		}
	}

	function formValidate(form) {
		let error = 0;
		let formRequired = document.querySelectorAll('._required');

		for (let i = 0; i < formRequired.length; i++) {
			const input = formRequired[i];
			formRemoveError(input);

			if (input.classList.contains('_phone')) {
				if (checkPhone(input)) {
					formAddError(input);
					error++;
				}
			} else {
				if (input.value === '') {
					formAddError(input);
					error++;
				}
			}
		}
		return error;
	}

	function formAddError(input) {
		input.classList.add('_error');
	}

	function formRemoveError(input) {
		input.classList.remove('_error');
	}

	function checkPhone(input) {
		return !/^((8|\+7)[\- ]?)?(\(?\d{3}\)?[\- ]?)?[\d\- ]{7,10}$/.test(input.value);
	}

	function renderOverlay(header, text) {
		const fragment = document.createDocumentFragment();

		const overlay = document.createElement('div');
		const wrapper = document.createElement('div');
		const title = document.createElement('h2');
		const subtitle = document.createElement('p');
		const button = document.createElement('button');

		overlay.classList.add('overlay');
		wrapper.classList.add('overlay__wrapper');
		title.classList.add('overlay__title');
		subtitle.classList.add('overlay__subtitle');
		button.classList.add('overlay__button');
		document.body.classList.add('hidden');

		title.textContent = header;
		subtitle.textContent = text;
		button.textContent = `Закрыть`;

		wrapper.appendChild(title);
		wrapper.appendChild(subtitle);
		wrapper.appendChild(button);
		overlay.appendChild(wrapper);

		fragment.appendChild(overlay);
		document.querySelector('.main').appendChild(fragment);

		overlay.addEventListener('click', function (e) {
			if (e.target.tagName === 'BUTTON' || e.target === overlay) {
				document.body.classList.remove('hidden');
				overlay.remove();
			}
		});
	}
})();

(function () {
	const openMenu = document.querySelector('.menu-button');
	const navigation = document.querySelector('.navigation');
	const navigationLogo = document.querySelector('.navigation__link');
	const headerLogo = document.querySelector('.logo');
	const links = document.querySelectorAll('.menu__link');
	const overlay = document.querySelector('.overlay-navigation');
	const body = document.body;


	function toggleMenu(e) {
		e.stopPropagation();
		openMenu.classList.toggle('displayed')
		navigation.classList.toggle('navigation--active');
		headerLogo.classList.toggle('hidden');
		navigationLogo.classList.toggle('vissible');
		body.classList.toggle('hidden');
		overlay.classList.toggle('show')
	}

	function closeMenu({ target }) {
		if (!navigation.contains(target)) {
			openMenu.classList.remove('displayed');
			navigation.classList.remove('navigation--active');
			headerLogo.classList.remove('hidden');
			navigationLogo.classList.remove('vissible');
			body.classList.remove('hidden');
			overlay.classList.remove('show');
		}
	}

	links.forEach(link => {
		link.addEventListener('click', e => {
			if (navigation.classList.contains('navigation--active')) {
				toggleMenu(e);
			}
		});
	});

	overlay.addEventListener('click', closeMenu);
	openMenu.addEventListener('click', toggleMenu);
})();

(function () {
	document.addEventListener('DOMContentLoaded', function () {
		const links = document.querySelectorAll('.menu__link');
		const orderButton = document.querySelector('.button__hero');

		orderButton.addEventListener('click', () => {
			document.getElementById('order').scrollIntoView({
				behavior: 'smooth',
				block: 'start',
			});
		});

		links.forEach(link => {
			link.addEventListener('click', function (e) {
				e.preventDefault();
				const blockID = e.target.getAttribute('href').substr(1);

				document.getElementById(blockID).scrollIntoView({
					behavior: 'smooth',
					block: 'start',
				});
			});
		});

		function headerSticky() {
			const header = document.querySelector('.header');
			header.classList.toggle('sticky', window.scrollY > 0);
		}

		window.addEventListener('scroll', headerSticky);
	});
})();

